#Com um determinado número integral n, escreva um programa para gerar um dicionário que contenha (i, i*i) tal que seja um número inteiro entre 1 e n (ambos incluídos). e então o programa deverá imprimir o dicionário. Suponha que a seguinte entrada seja fornecida ao programa: 8 Então, a saída deve ser: {1: 1, 2: 4, 3: 9, 4: 16, 5: 25, 6: 36, 7: 49, 8: 64 }

